import React from 'react';
import { ThemeProvider } from '@material-ui/core/styles';

import { theme } from './globalTheme';
import './App.scss';

import { Header } from './containers';
import { Home } from './pages';

function App() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <Header />
        <Home />
      </ThemeProvider>
    </div>
  );
}

export default App;
